import * as React from 'react';
import Box from '@mui/material/Box';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import { FixedSizeList } from 'react-window';
import axios from 'axios';

function handleSelect(selected){
    axios.post('', {name:'stay alive', author:"tuna", song:[
        [
            {
                "lyrics": "Hey"
            },
            {
                "lyrics": "Jude",
                "chords": "F"
            },
            {
                "lyrics": "don't"
            },
            {
                "lyrics": "make"
            },
            {
                "lyrics": "it"
            },
            {
                "lyrics": "bad",
                "chords": "C"
            }
        ],
        [
            {
                "lyrics": "Take"
            },
            {
                "lyrics": "a"
            },
            {
                "lyrics": "sad",
                "chords": "C7"
            },
            {
                "lyrics": "song",
                "chords": "C4/7"
            },
            {
                "lyrics": "and"
            },
            {
                "lyrics": "make"
            },
            {
                "lyrics": "it"
            },
            {
                "lyrics": "better",
                "chords": "F"
            }
        ],
        [
            {
                "lyrics": "Remember",
                "chords": "Bb"
            },
            {
                "lyrics": "to"
            },
            {
                "lyrics": "let"
            },
            {
                "lyrics": "her"
            },
            {
                "lyrics": "into"
            },
            {
                "lyrics": "your"
            },
            {
                "lyrics": "heart",
                "chords": "F"
            }
        ],
        [
            {
                "lyrics": "Then"
            },
            {
                "lyrics": "you"
            },
            {
                "lyrics": "can"
            },
            {
                "lyrics": "start",
                "chords": "C"
            },
            {
                "lyrics": "to"
            },
            {
                "lyrics": "make",
                "chords": "C7"
            },
            {
                "lyrics": "it"
            },
            {
                "lyrics": "better",
                "chords": "F"
            }
        ]
]})
    console.log(selected.song[0])
}

function renderRow({songs, index, style}) {
const song = songs[index];
  return (
    <ListItem style={style} key={index} component="div" disablePadding>
      <ListItemButton onClick={()=>{handleSelect(song)}}>
        <ListItemText primary={`${index + 1}`} />
        <ListItemText primary={`${song.name}`} value={song.name}/>
        <ListItemText primary={`Author: ${song.author}`} />
      </ListItemButton>
    </ListItem>
  );
}

export default function Results({songs}) {
  return (
    <Box
      sx={{ width: '100%', height: 400, maxWidth: 400, bgcolor: 'background.paper' }}
    >
      <FixedSizeList
        height={400}
        width={500}
        itemSize={60}
        itemCount={songs.length}
        overscanCount={5}
      >  
        {({ index, style }) => renderRow({ index, style, songs })}
      </FixedSizeList>
    </Box>
  );
}
